window.bookSummaryJSON = "<p>He rescued her from certain death. Now she must accept his claim or doom them both.</p> <p>After being left for dead by her people, Aliena wakes up under the care of alien pirates. She escapes, only to be captured by a creature straight from her darkest nightmares, bent on the destruction of everything she holds dear.</p> <p>An Eok warrior turned outlaw, Kamal is one to be reckoned with. He is on a mission for the Eok nation, and his only goal is to find and save the humans before he can return to his old life. He has no intention of allowing a headstrong human female to get in his way.</p> <p>As Aliena embarks on a mission to rescue her uncle from Minister Knut’s clutches, Kamal is at a crossroads. If he chooses to help the human, the price might well be his own life.</p> <p>When the Mating Venom unleashes its torment, Kamal has to decide. Will he change his ways and claim Aliena’s heart, or is the life of an outlaw too hard to leave behind?</p> <p>Each book in the Eok Warriors series features a different couple and can be enjoyed as a standalone romance, however it is recommend to read them in order for maximum enjoyment.</p> <p>The Eok Warrios series is a complete series in the following order:</p> <p>Venomous Craving</p> <p>Venomous Hunger</p> <p>Venomous Heart</p> <p>Venomous Lust</p> <p>Publisher's Note: This gripping sci-fi alien romance has it all: alpha male alien heroes, passion and danger. It also contains explicit themes and is intended for adults only.</p>"; 
